import React from 'react';
import style from '../About/About.module.css'

const About = () => {
    return(
        <div className={style.aboutContainer}>
            <h1>Hi everyone! My name is Karina and I'm in "class 35b"</h1>
            <br></br>
            <h3>This is my first proyect so far and I hope you enjoy it as much as I, when I made it. Thank you so much for seen my work here, have a wonderfull life!</h3>
        </div>
    )
}

export default About
